import { Card,Button } from "@mantine/core";
import React from "react";
import icon from './delete.ico'

function List({name,object_id}){
    return(
        <Card style={{height:'100px',width:'200px',display:'flex',position:'relative'}} withBorder>
            <table>
                <tbody>
                    <tr>
                        <center>
                        <td>{name}</td>
                        <td><a><img src={icon} style={{position:'absolute',right:'10px'}} onClick={()=>{console.log(object_id)}}/></a></td>
                        </center>
                    </tr>
                </tbody>
            </table>
        </Card>
    )
}

export default List;
